import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import API from '../api';

const EditIPO = () => {
  const { id } = useParams();
  const navigate = useNavigate();

  const [form, setForm] = useState({
    company_name: '',
    price_band: '',
    open_date: '',
    close_date: '',
    issue_size: '',
    issue_type: '',
    listing_date: '',
    status: 'upcoming',
    ipo_price: '',
    listing_price: '',
    current_market_price: '',
  });

  const [logo, setLogo] = useState(null);
  const [rhp, setRhp] = useState(null);
  const [drhp, setDrhp] = useState(null);

  useEffect(() => {
    if (id !== 'new') {
      API.get(`ipo/${id}/`).then(res => setForm(res.data));
    }
  }, [id]);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const data = new FormData();
    Object.entries(form).forEach(([key, value]) => {
      data.append(key, value);
    });

    if (logo) data.append('logo', logo);
    if (rhp) data.append('rhp_pdf', rhp);
    if (drhp) data.append('drhp_pdf', drhp);

    // Debug logs (optional)
    console.log("Submitting IPO:", form);
    console.log("Logo:", logo);
    console.log("RHP:", rhp);
    console.log("DRHP:", drhp);

    try {
      if (id === 'new') {
        await API.post('ipo/', data, {
          headers: { 'Content-Type': 'multipart/form-data' },
        });
      } else {
        await API.put(`ipo/${id}/`, data, {
          headers: { 'Content-Type': 'multipart/form-data' },
        });
      }

      alert('✅ IPO saved successfully!');
      navigate('/admin');
    } catch (error) {
      console.error('Error saving IPO:', error);
      alert('❌ Failed to save IPO. Check console for details.');
    }
  };

  return (
    <div className="p-6 max-w-xl mx-auto bg-white rounded shadow">
      <h2 className="text-xl font-bold mb-4">
        {id === 'new' ? 'Add New IPO' : 'Edit IPO'}
      </h2>

      <form onSubmit={handleSubmit} className="space-y-3" encType="multipart/form-data">
        <input className="border p-2 w-full" name="company_name" value={form.company_name} onChange={handleChange} placeholder="Company name" />
        <input className="border p-2 w-full" name="price_band" value={form.price_band} onChange={handleChange} placeholder="Price band" />
        <input className="border p-2 w-full" type="date" name="open_date" value={form.open_date} onChange={handleChange} />
        <input className="border p-2 w-full" type="date" name="close_date" value={form.close_date} onChange={handleChange} />
        <input className="border p-2 w-full" name="issue_size" value={form.issue_size} onChange={handleChange} placeholder="Issue size" />
        <input className="border p-2 w-full" name="issue_type" value={form.issue_type} onChange={handleChange} placeholder="Issue type" />
        <input className="border p-2 w-full" type="date" name="listing_date" value={form.listing_date} onChange={handleChange} />
        <select className="border p-2 w-full" name="status" value={form.status} onChange={handleChange}>
          <option value="upcoming">Upcoming</option>
          <option value="ongoing">Ongoing</option>
          <option value="listed">Listed</option>
        </select>
        <input className="border p-2 w-full" name="ipo_price" value={form.ipo_price} onChange={handleChange} placeholder="IPO price" />
        <input className="border p-2 w-full" name="listing_price" value={form.listing_price} onChange={handleChange} placeholder="Listing price" />
        <input className="border p-2 w-full" name="current_market_price" value={form.current_market_price} onChange={handleChange} placeholder="Current market price" />

        <label className="block">Logo:
          <input type="file" accept="image/*" onChange={e => setLogo(e.target.files[0])} />
        </label>

        <label className="block">RHP (PDF):
          <input type="file" accept=".pdf" onChange={e => setRhp(e.target.files[0])} />
        </label>

        <label className="block">DRHP (PDF):
          <input type="file" accept=".pdf" onChange={e => setDrhp(e.target.files[0])} />
        </label>

        <button className="bg-green-600 text-white px-4 py-2 rounded">Save</button>
      </form>
    </div>
  );
};

export default EditIPO;
